import { Link } from "react-router-dom";
import classes from "./NavBar.module.css";
export default function NavBar() {
  return (
    <header className={classes.header}>
      <nav>
        <span>OtoCznY BloG</span>
        <ul className={classes.list}>
          <li>
            <Link to="/">Home</Link>
          </li>
           <li>
            <Link to="/">Home</Link>
          </li>
           <li>
            <Link to="/">Home</Link>
          </li>
        </ul>
      </nav>
    </header>
  );
}
